import { Link } from 'react-router-dom';
import './Submit.css'
function Submit(){
    function finalSubmit(event) {
        event.preventDefault()
        history.go("./Thanks");        
      }
    return(
        <div className="box">
            <div className='submit'>
            <button onClick={finalSubmit()}>Submit</button>
            <Link>
            <p>Go Back</p>
            </Link>
            </div>
        </div>
    )
}
export default Submit;
